INSERT INTO `SEMS_ASSESSMENT_INDEX` VALUES ('07475ead-8ee6-4b1c-ba6c-5400f93d38c1','量化指标',5,'在有正式刊号的公开出版物上发表的校企合作论文，每篇5分；****学院学刊，每篇3分。','以出版刊物为准。',10.00,NULL,NULL,'2018-11-23 12:04:29',NULL,'2018-11-23 12:04:29',NULL,0),('15a863d9-9bbd-46c2-b622-2ef74a43584a','量化指标',8,'邀请企业人员来校培训、讲座，每场得1分。','培训、讲座以讲义、讲稿、照片和报道稿为准。',3.00,NULL,NULL,'2018-11-23 12:04:29',NULL,'2018-11-23 12:04:29',NULL,0),('3644ee82-09e5-4791-b841-17c58cc7fca5','量化指标',2,'建立完善的校企合作档案，校外实践基地4分，其余各项各3分。','以填报校企合作档案系统和上传佐证材料为准。共八项：校外实践基地、校内共建基地、社会服务、订单培养、共编教材、教学研基金、学术成果、共建专业。',25.00,NULL,NULL,'2018-11-23 12:04:29',NULL,'2018-11-23 12:04:29',NULL,0),('94da9b35-4290-43d8-8e75-1084d9eca473','量化指标',7,'校企合作开办“订单班”、“委培班”等，得5分。','每班20人以上，有培养协议、班级名单(开班合影)、报道等,以正式成立为准。',5.00,NULL,NULL,'2018-11-23 12:04:29',NULL,'2018-11-23 12:04:29',NULL,0),('9c6eb9ee-1960-40d6-bf74-c06549f9fbc3','量化指标',9,'共建产学研育人平台，并正常运作，得5分；共建后每年取得成果，得2分。','须提供合作协议（合同）、方案、平台制度文件和图片等等。',5.00,NULL,NULL,'2018-11-23 12:04:29',NULL,'2018-11-23 12:04:29',NULL,0),('9e91743e-7340-4f81-b354-2787d32bee9f','量化指标',4,'校企共同编写教材（不含再版），该年度公开发行每部3分；共同开发课程每门2分。','教材以公开发行以出版合同或样书为准；院内使用以教务处证明及样书为准；课程开发则以开发协议、教务处证明为准。',5.00,NULL,NULL,'2018-11-23 12:04:29',NULL,'2018-11-23 12:04:29',NULL,0),('a4806aed-407f-45a8-9304-86121611a5fb','量化指标',3,'新签订协议并挂牌的较稳定的校外实习实训基地，每1家得4分；原有的实习基地过期续签不算分，协议过期不及时续签的扣2分/家。','新签约基地是较稳定合作企业，需提供签约协议、照片和相关学生实习名单等佐证材料。原基地过期续签时间以当年9月1日为限。',10.00,NULL,NULL,'2018-11-23 12:04:29',NULL,'2018-11-23 12:04:29',NULL,0),('bfa044b4-551a-442c-aa33-71e0dfcdfe67','量化指标',1,'各系召开的校企合作工作专题会议。每次得2分。最高5分。校企网站或校企合作专栏报道每篇3分，最高10分。','有专门会议记录。中心与系部网站内容应实时更新。',15.00,NULL,NULL,'2018-11-23 12:04:29',NULL,'2018-12-09 16:36:44','03217bd2-0607-419f-93fb-91588e669acc',0),('e1a66b50-3a56-46a4-93e4-37cbe5da2424','量化指标',6,'企业为本系设立奖教、学、研基金（含企业赞助技能竞赛活动经费），每满1万元得1分，企业给学生生活补贴不算。','以企业设立奖教、学、研协议，企业出资证明或校方收款凭证为准。',5.00,NULL,NULL,'2018-11-23 12:04:29',NULL,'2018-11-23 12:04:29',NULL,0),('ef218153-c12e-4b5f-84d4-6e6fab1a697d','量化指标',10,'取得的横向课题每万元2分，省部级产学研纵向课题每项5分。','横向课题须提供合作协议（合同）；纵向课题须提供批文、立项书。',17.00,NULL,NULL,'2018-11-23 12:04:29',NULL,'2018-11-23 12:04:29',NULL,0);

